INSERT INTO `szemelyi_edzok` (`szeID`, `szeUID`, `szeuFelhasznalonev`, `szeEmail`, `szeTelefon`, `szeVegzetseg`, `szeLeiras`, `szeLeiras2`, `szeElerhetoseg`, `szeKepek`, `szeEgyeb`, `szeVisibility`) VALUES
(1, 1, 'Sablon Név', 'sablonemail@gmail.com', '+36 123456789', 'IWI Fitness instruktor', 'Szeretnél valami újat kipróbálni? Nem tudod, belevágj-e?\n\nJó lenne kicsit fogyni vagy izmosabb szeretnél lenni? Ismerem az érzést. Sportolói karrierem elején én is így éreztem. Miért pont nekem sikerülne? De tapasztalatból tudom, elég, ha veszel egy mély levegőt és belevágsz. Ne tétovázz! Hidd el, csak az elindulás nehéz, utána már menni fog.\n\nA sport iránti szenvedélyem\n2008-tól 2019-ig versenyszerűen kajakoztam, ami nemcsak fizikailag, de mentálisan is megerősített. 3 éven keresztül a kitartásomnak köszönhetően a dobogó legmagasabb fokára állhattam. Bebizonyosodott számomra, hogy ha kitűzünk egy célt, azt kitartó munkával képesek vagyunk elérni.\n\nA sport iránti szenvedélyem azóta is az életem meghatározó részét képezi.', 'Új kihívások és az egészséges életmód\n2019-ben úgy döntöttem, új kihívások elé nézek. Elhatároztam, hogy tudatosan építem izomzatomat, figyelve a táplálkozásra, a táplálékkiegészítők használatára és mindezek egészséges egyensúlyára.\n\nNégy évig dolgoztam a logisztika területén, így pontosan tudom, milyen kihívásokkal jár a munka és a mindennapi stressz mellett fenntartani az egészséges életmódot. Ennek ellenére sikerült megvalósítanom.\n\nHiszem, hogy Te is képes vagy rá\nÚgy gondolom, hogy mindenki képes változtatni az életén, ha igazán elhatározza, függetlenül a napi teendők és kihívások mennyiségétől. Hiszem, hogy Neked is sikerülni fog. Ha bízol bennem, ketten együtt megcsináljuk. Én azon leszek, hogy mindenben segítselek téged.', '{ \n        \"instagram\": \"https://www.instagram.com/sablon/\", \n        \"facebook\": \"https://www.facebook.com/sablon/\", \n        \"tiktok\": \"https://www.tiktok.com/sablon/\"\n    }', '{\n    \"profilkep\": \"images/edzo.webp\",\n    \"galeriakepeim\": [\n        \"images/falomwfwa.jpg\",\n        \"images/falomwfwa.jpg\"\n    ]\n}', 'valami', 0),
