(9, 'True Whey Protein - LiftZone', 22000, 'A LiftZone prémium minőségű fehérjepora kiváló választás az izomnövekedés és regeneráció támogatására. A fekete és sárga dizájn modern és erőteljes megjelenést biztosít. A termék kiemelkedő fehérjetartalommal rendelkezik, és különféle ízekben kapható, például csokoládé, vanília és eper. Ideális edzés utáni italnak vagy egészséges fehérjepótlásnak a nap bármely szakában.', '2025-02-27 12:31:25', 1),
(10, 'Whey Pink - LiftZone', 28000, 'A LiftZone női fehérjepor kifejezetten hölgyek számára lett kifejlesztve, hogy támogassa az izomtónus javítását és az egészséges életmódot. A fekete és rózsaszín elegáns csomagolás modern és nőies dizájnt kölcsönöz. Alacsony kalóriatartalommal és hozzáadott vitaminokkal rendelkezik, hogy segítse a fitt és energikus mindennapokat. Kapható csokoládé, vanília és bogyós gyümölcs ízekben.', '2025-02-27 12:32:28', 1),
(11, '100% Kreatin-monohidrát', 18000, 'A LiftZone kreatinpor egy kiváló minőségű táplálékkiegészítő, amely növeli az erőt és az állóképességet. A fekete és sárga, újrazárható tasak modern és professzionális megjelenést biztosít. Segíti a teljesítmény fokozását, az izmok gyorsabb regenerálódását és a robbanékonyság növelését. Tökéletes választás minden sportoló és fitneszrajongó számára.', '2025-02-27 12:33:02', 1);
